B.a3a=new A.aR("1. Aceita\xe7\xe3o dos Termos\nAo acessar ou utilizar este aplicativo (\u201cApp\u201d), voc\xea concorda integralmente com os presentes Termos de Servi\xe7o. Caso n\xe3o concorde com qualquer cl\xe1usula, dever\xe1 interromper o uso imediatamente.",null,null,null,null,null,null,null,null,null)
B.bj=new A.dp(null,10,null,null)
B.a3K=new A.aR("2. Objetivo do App\nO App tem como finalidade oferecer conte\xfados, atividades e recursos did\xe1ticos para a forma\xe7\xe3o de professores da rede estadual de ensino, com foco no ensino e na compreens\xe3o da L\xedngua Brasileira de Sinais (Libras) e da cultura da comunidade surda.",null,null,null,null,null,null,null,null,null)
B.a3A=new A.aR("3. P\xfablico-Alvo\nO uso do App \xe9 destinado exclusivamente a professores, coordenadores pedag\xf3gicos e demais profissionais de educa\xe7\xe3o vinculados \xe0 rede estadual de ensino, mediante cadastro e autoriza\xe7\xe3o pr\xe9via da Secretaria de Educa\xe7\xe3o.",null,null,null,null,null,null,null,null,null)
B.a3V=new A.aR("4. Cadastro e Conta do Usu\xe1rio\nPara utilizar o App, \xe9 necess\xe1rio realizar um cadastro com dados pessoais e institucionais corretos e atualizados. O usu\xe1rio \xe9 respons\xe1vel por manter a confidencialidade de sua senha e credenciais de acesso. O uso da conta \xe9 pessoal e intransfer\xedvel.",null,null,null,null,null,null,null,null,null)
B.a3M=new A.aR("5. Uso Permitido\n\xc9 permitido ao usu\xe1rio: Acessar aulas, v\xeddeos, materiais de estudo e exerc\xedcios dispon\xedveis no App; Utilizar os recursos para fins exclusivamente educacionais; Participar de atividades, avalia\xe7\xf5es e f\xf3runs de discuss\xe3o propostos.",null,null,null,null,null,null,null,null,null)
B.a3T=new A.aR("6. Uso Proibido\nO usu\xe1rio n\xe3o poder\xe1: Reproduzir, copiar, distribuir ou comercializar conte\xfados do App sem autoriza\xe7\xe3o expressa; Utilizar o App para fins que n\xe3o sejam educacionais; Compartilhar credenciais de acesso com terceiros; Inserir informa\xe7\xf5es falsas, ofensivas ou discriminat\xf3rias no ambiente virtual.",null,null,null,null,null,null,null,null,null)
B.a3k=new A.aR("7. Direitos Autorais e Propriedade Intelectual\nTodos os conte\xfados, materiais audiovisuais, textos, imagens e recursos interativos disponibilizados no App s\xe3o protegidos por leis de propriedade intelectual, sendo de titularidade da Secretaria de Educa\xe7\xe3o ou de seus parceiros autorizados. \xc9 proibida qualquer reprodu\xe7\xe3o ou uso n\xe3o autorizado.",null,null,null,null,null,null,null,null,null)
B.a3u=new A.aR("8. Prote\xe7\xe3o de Dados e Privacidade\nOs dados pessoais e acad\xeamicos coletados ser\xe3o utilizados apenas para fins de autentica\xe7\xe3o, gest\xe3o de participa\xe7\xe3o e emiss\xe3o de certificados. O App segue as diretrizes da Lei Geral de Prote\xe7\xe3o de Dados (Lei n\xba 13.709/2018 \u2013 LGPD). N\xe3o ser\xe3o compartilhadas informa\xe7\xf5es pessoais com terceiros sem consentimento, exceto quando exigido por lei.",null,null,null,null,null,null,null,null,null)
B.a3n=new A.aR("9. Disponibilidade e Altera\xe7\xf5es\nA Secretaria de Educa\xe7\xe3o reserva-se o direito de: Alterar ou atualizar conte\xfados e funcionalidades sem aviso pr\xe9vio; Suspender temporariamente o funcionamento do App para manuten\xe7\xe3o ou melhorias; Encerrar o servi\xe7o, mediante aviso pr\xe9vio, preservando o acesso aos certificados j\xe1 emitidos.",null,null,null,null,null,null,null,null,null)
B.a3h=new A.aR("10. Responsabilidades do Usu\xe1rio\nO usu\xe1rio \xe9 respons\xe1vel por: Utilizar o App de forma \xe9tica e respeitosa; Garantir que seu dispositivo possua os requisitos t\xe9cnicos m\xednimos; Zelar pela veracidade das informa\xe7\xf5es fornecidas.",null,null,null,null,null,null,null,null,null)
B.a3l=new A.aR("11. Responsabilidades do Fornecedor\nA Secretaria de Educa\xe7\xe3o compromete-se a: Fornecer suporte t\xe9cnico b\xe1sico; Garantir a integridade dos conte\xfados disponibilizados; Manter a seguran\xe7a da plataforma.",null,null,null,null,null,null,null,null,null)
B.a3Y=new A.aR("12. Disposi\xe7\xf5es Gerais\nEstes Termos poder\xe3o ser atualizados periodicamente. A vers\xe3o mais recente estar\xe1 sempre dispon\xedvel no App. O uso cont\xednuo ap\xf3s altera\xe7\xf5es implica concord\xe2ncia com os novos termos.",null,null,null,null,null,null,null,null,null)
B.a3q=new A.aR("13. Foro\nFica eleito o foro da Comarca da capital do estado como competente para dirimir quaisquer quest\xf5es decorrentes destes Termos, com ren\xfancia a qualquer outro, por mais privilegiado que seja.",null,null,null,null,null,null,null,null,null)
